convert between clause of sql to mongoose<p>I have a table with name <code>OgShift</code> and I want to fetch all the records if current DateTime lies between <code>ShiftStartTime</code> and <code>ShiftEndTime</code>. It works perfectly fine in SQL but I need to implement it for <code>MongoDB</code> using <code>node and mongoose</code>.</p>

<p>here is my query.</p>

<pre><code>SELECT * FROM dbo.OgShift 
WHERE '2018-12-18 04:43:59.810' BETWEEN ShiftStartTime AND ShiftEndTime
AND isActive=1
</code></pre>

<p><strong>Database collection</strong>
<a href="https://i.stack.imgur.com/pPIbM.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/pPIbM.png" alt="enter image description here"></a></p>

<p><strong>Schema</strong></p>

<pre><code>let OgShift=new mongoose.Schema({
    ShiftName:String,
    ShiftStartTime:Date,
    ShiftEndTime:Date,
    isActive:Boolean    
})
</code></pre>

<p><strong>Route code</strong></p>

<pre><code>app.get('/shift',async (req,res)=&gt;{
    var ShiftStartTime = new Date(req.query.ShiftStartTime).toISOString();
    var ShiftEndTime = new Date(req.query.ShiftEndTime).toISOString();

    let result = await OgShift.OgShift.find({
        ShiftStartTime: {
            $gt: ShiftStartTime
        },
        ShiftEndTime: {
            $lt: ShiftEndTime
        }
    });
    res.send('ShiftStartTime is' + ShiftStartTime + " end date is " + ShiftEndTime + result);

})
</code></pre>

<p><strong>Result on Browser</strong>
<a href="https://i.stack.imgur.com/xc39a.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/xc39a.png" alt="enter image description here"></a>
<strong>Code after commenting the date filters</strong></p>

<pre><code>app.get('/shift',async (req,res)=&gt;{
    var ShiftStartTime = new Date(req.query.ShiftStartTime).toISOString();
    var ShiftEndTime = new Date(req.query.ShiftEndTime).toISOString();

    let result = await OgShift.OgShift.find({});
    res.send('ShiftStartTime is' + ShiftStartTime + " end date is " + ShiftEndTime + result);

})
</code></pre>

<p><strong>Result after commenting the filters</strong>
<a href="https://i.stack.imgur.com/O8Hhz.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/O8Hhz.png" alt="&lt;code&gt;enter image description here&lt;/code&gt;"></a></p>

