<pre><code>    async update_server_attribute(db, server_id, attribute_name, new_value){
        var my_query = { "server_id": server_id }
        var updated_val = { $set: {attribute_name: new_value } }
        db.collection("servers").updateOne(my_query, updated_val)
    },
</code></pre>

<p>I would expect the dict to update to the following:</p>

<pre><code>{"server_name" : new_val}
</code></pre>

